(window.webpackJsonp=window.webpackJsonp||[]).push([[65],{594:function(t,a,s){"use strict";s.r(a);var r=s(6),e=Object(r.a)({},(function(){var t=this,a=t.$createElement,s=t._self._c||a;return s("ContentSlotsDistributor",{attrs:{"slot-key":t.$parent.slotKey}},[s("h1",{attrs:{id:"_7月"}},[s("a",{staticClass:"header-anchor",attrs:{href:"#_7月"}},[t._v("#")]),t._v(" 7月")]),t._v(" "),s("p",[t._v("从6月初入职新公司以来，转眼已经过去了2个多月了，还记得刚来的第一个周末，就被通知周末要加班，然后是7月初被安排到另外一个项目去支援一周，地点是位于中南路的设计院。一周过后回金融港没呆几天又被安排到另外一个项目，这个项目竟然需要出差，虽说早就料到政府类型的项目会存在出差的情况，但是没想到最后这件事会落在自己的头上，没办法，出差就出差吧。出差的地方是鄂州，距离上不算太远，地铁11号线到达葛店南再打个车就到了，如果周末不加班，可以选择做地铁回武汉。但一切都是我想的太多，7月8号过去的，在去之前就告诉我们说，这个项目时间上会比较紧，20号要做完第一阶段的所有开发相关的工作，因为要给别人演示。于是乎呢，就开始了连续2周的加班生活，姑且不说工作条件有多艰苦，连续2周的加班应该是我入行以来，加班强度最大的一次。在20号顺利开发完后，大概是在22号的时候，通知我们回武汉。当天我们退了酒店，开好了发票，订好了车，在下午2点踏上了回武汉的返程之旅，大约在4点的时候，我们就到达了公司。在到达公司之后，做的第一件事情就是，填报销申请，毕竟公司的报销流程还是比较慢的，早一点填报销，就意味着早一点拿到钱。在填完报销报销之后，然后又请了一天假好好休息下，毕竟连续上2周的班还是挺累的。")]),t._v(" "),s("h2",{attrs:{id:"长沙之行"}},[s("a",{staticClass:"header-anchor",attrs:{href:"#长沙之行"}},[t._v("#")]),t._v(" 长沙之行")]),t._v(" "),s("p",[t._v("请了一天假之后，决定和媳妇去长沙去玩一下。于是立马买票，周五很早，迎着清晨的第一缕阳光，踏上了去长沙的火车。整个行程还是安排的比较满的。吃了笨萝卜浏阳菜馆，打卡了超级文和友，去了橘子洲看到了毛爷爷，领略了湘江两岸的夜景。第二天一早，从吃一碗长沙米粉开始，吃完坐地铁去岳麓山，然后体验了下索道，当天下午又去笨萝卜去吃了个饭（强烈推荐），然后买了点特产，长沙臭豆腐和糖油粑粑，收拾好心情就踏上了回武汉的火车！")]),t._v(" "),s("h1",{attrs:{id:"_8月"}},[s("a",{staticClass:"header-anchor",attrs:{href:"#_8月"}},[t._v("#")]),t._v(" "),s("strong",[t._v("8月")])]),t._v(" "),s("p",[t._v("8月初的第一周，因为手上有一点需求，周一到周五有3天是在加班，并且是加班到22点以后的，感觉也是有点累的。不过在那之后基本上都不怎么忙了，也不怎么加班。所以到目前为止，这个项目给我的感觉就是，大家都不知道怎么做，都是走一步看一步，还是在摸索的阶段。可能前面刚做完，后面就改了，所以整个项目充满了不确定性。整个8月份，基本上都是处于一个比较清闲的状态，也正是因为比较清闲，才会有那么多的时间水群！")])])}),[],!1,null,null,null);a.default=e.exports}}]);